          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/my-profile">
            <MyProfile />
          </Route>
          <Route path="/Fretboard">
            <Fretboard/>
          </Route>
        </Switch>
      </div>
    </Router>

      </div>
    )
  }
}


export default App;
